import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import signupimg from "../assets/SignUp.jpg";
import Footer from "../components/Footer";

function SignUp() {
  return (
    <>
      <Navbar />
      <Hero
        cname="hero-mid"
        heroimg={signupimg}
        title="Yo! Sign Up Here :)"
        btnclass="hide"
      />
      <Footer />
    </>
  );
}

export default SignUp;
